import React from 'react';

const About = () => {
  return (
    <div className="about-page">
      <h2>Sobre Nós</h2>
      <p>
        Somos especialistas em flores exóticas e raras, dedicados a trazer as variedades
        mais incomuns e belas de todos os cantos do mundo para colecionadores e entusiastas.
      </p>
      <p>
        Nossa equipe de horticultores possui mais de 20 anos de experiência no cultivo
        e preservação de espécies raras.
      </p>
    </div>
  );
};

export default About;
